import React from 'react'
import './Navbar.css'
import logo from '../Assets/logo copy.PNG'
const Navbar = () => {
  return (
    <div className='Navbar'>
  <div className="Nav-logo">
    <img src={logo} alt="" width="150px"/>
  </div>

    </div>
  )
}

export default Navbar
